import styled from "styled-components";

function App() {
  return (
    <StyledApp>
      <BoxShadow>
        <h1>BoxShadow</h1>
        <Box></Box>
        <Controls></Controls>
      </BoxShadow>
    </StyledApp>
  );
}

export default App;

const StyledApp = styled.div``;
const BoxShadow = styled.div``;
const Box = styled.div``;
const Controls = styled.div``;
